import React, { useEffect } from 'react';

const Form = () => {

    useEffect

    return (
        <div className="formulario">
            <form method="POST">
                <input type="text" />
                <input type="text" />
                <input type="number" />
                <input type="submit" />

            </form>  
        </div>
    );
};

export default Form;
